import React from "react";
import * as S from "./styled";
export default function Input({ passWordEyes, ...rest }) {
  if (passWordEyes) {
    return (
      <S.WrapInputPassword>
        <S.Input {...rest} />
        <div className="wrap-eye">
          <i className="far fa-eye-slash" />
          <i className="far fa-eye" />
        </div>
      </S.WrapInputPassword>
    );
  }
  return (
    <>
      <S.Input {...rest} />
    </>
  );
}
